import { TextField } from "@material-ui/core"
import { Form } from "react-bootstrap"

function CreateItem(){

    const FormTemplate = (label, name) => {
        return(
        <TextField 
        required
        variant="outlined"
        id="outline-required"
        label= {label}
        name= {name}
        onChange={e=>console.log(e.target.value)}
      ></TextField>
        )
    }



    return(
        <div>
            <h1>CreateItem</h1>


        <Form>
            {FormTemplate("Name", "name")}
            {FormTemplate("Expiration Date", "exp_date")}
            {FormTemplate("Storage Type", "storage")}



        </Form>



        </div>
    )
}
export default CreateItem
